#include<stdio.h>
void merge_sort(int[],int,int);
void merge(int[],int,int,int);
int main()
{
	int t;
	scanf("%d",&t);
	while(t--)
	{
		int n;
		scanf("%d",&n);
		int a[n],b[n],i,j;
		for(i=0;i<n;i++)
			scanf("%d",&a[i]);
		for(i=0;i<n;i++)
			scanf("%d",&b[i]);
		merge_sort(a,0,n-1);
		merge_sort(b,0,n-1);
		int f=0;
		for(i=0;i<n;i++)
		{
			if(a[i]>b[i])
			{
				f=1;
				break;
			}
		}
		if(f==0)
			printf("WIN\n");
		else
			printf("LOSE\n");
	}
}
void merge_sort(int a[],int be,int e)
{
	if(be<e)
	{
		int m=(be+e)/2;
		merge_sort(a,be,m);
		merge_sort(a,m+1,e);
		merge(a,be,m,e);
	}
}
void merge(int a[],int be,int m,int e)
{
	int i=be,j=m+1,temp[be+e],k=0;
	while(i<=m && j<=e)
	{
		if(a[i]>a[j])
		{
			temp[k]=a[j++];
		}
		else
		{
			temp[k]=a[i++];
		}
		k++;
	}
	while(i<=m)
	{
		temp[k]=a[i++];
		k++;
	}
	while(j<=e)
	{
		temp[k]=a[j++];
		k++;
	}
	i=0;
	for(k=be;k<=e;k++)
	{
		a[k]=temp[i++];
	}
}

