import Swift

/**
 * Read input from STDIN. Print your output to STDOUT 
 * Use readLine() to read input from STDIN
 * use print to write your output to STDOUT
*/
// Below is an example on how to take integer input and print it.
// a = parse(Int,readline(STDIN))
// print(a)

var t = Int(readLine()!)!

func maxOf(_ arr: [Int]) -> (Int, Int) {
 var max = arr[0]
 var index = 0 
 for i in 1..<(arr.count-1) {
 if arr[i] > max {
 max = arr[i]
 index = i
 }
 }
 return (max, index)
}

while t > 0 {
 let n = Int(readLine()!)!
 var ev = readLine()!.split(separator: " ").map { Int($0)! }
 var ep = readLine()!.split(separator: " ").map { Int($0)! }
 for _ in 1..<n {
 let a = maxOf(ev)
 let b = maxOf(ep)
 if a.0 > b.0 {
 print("LOSE")
 break
 } else {
 ev.remove(at: a.1)
 ep.remove(at: b.1)
 }
 }
 if ev.count == 1 { print("WIN") }
 t -= 1
}

