Q1_Correct_Answer:
package main
import (
	"bufio"
	"flag"
	"fmt"
	"log"
	"os"
	"runtime/pprof"
	"sort"
	"strconv"
	"strings"
)

var reader *bufio.Reader = bufio.NewReader(os.Stdin)
var writer *bufio.Writer = bufio.NewWriter(os.Stdout)

func printf(f string, a ...interface{}) { fmt.Fprintf(writer, f, a...) }

var (
	enableLog = false
)

func println(a ...interface{}) {
	if enableLog {
		fmt.Println(a...)
	}
}

func scanf(f string, a ...interface{}) { fmt.Fscanf(reader, f, a...) }

var cpuprofile = flag.String("cpuprofile", "", "write cpu profile to file")

func main() {
	defer writer.Flush()
	flag.Parse()

	if *cpuprofile != "" {
		f, err := os.Create(*cpuprofile)
		if err != nil {
			log.Fatal(err)
		}
		pprof.StartCPUProfile(f)
		defer pprof.StopCPUProfile()
	}

	var T, N int

	scanf("%d\n", &T)

	for t := 0; t < T; t++ {

		scanf("%d\n", &N)

		villains, _ := reader.ReadString('\n')

		vs := strings.Split(villains, " ")

		var villain []int

		for i := 0; i < N; i++ {
			v, _ := strconv.Atoi(strings.TrimSpace(vs[i]))
			villain = append(villain, v)
		}

		heros, _ := reader.ReadString('\n')

		hs := strings.Split(heros, " ")

		var hero []int

		for i := 0; i < N; i++ {
			h, _ := strconv.Atoi(strings.TrimSpace(hs[i]))
			hero = append(hero, h)
		}

		sort.Sort(sort.Reverse(sort.IntSlice(villain)))
		sort.Sort(sort.Reverse(sort.IntSlice(hero)))

		println(villain)
		println(hero)

		win := true

		for i := 0; i < N; i++ {

			if hero[i] <= villain[i] {
				win = false
				break
			}
		}
		if win {
			printf("WIN\n")
		} else {
			printf("LOSE\n")
		}
	}
}
